import React from 'react';
import { motion } from 'framer-motion';

const Footer = () => {
  const socialIcons = [
    { name: 'GitHub', icon: 'üêô', link: 'https://github.com/abhishek' },
    { name: 'LinkedIn', icon: 'üëî', link: '#' },
    { name: 'Twitter', icon: 'üê¶', link: '#' },
    { name: 'Instagram', icon: 'üì∑', link: '#' },
  ];

  return (
    <footer className="py-16 bg-gray-900 text-white">
      <div className="container mx-auto px-4 text-center">
        <motion.div 
          className="text-2xl mb-8 italic"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          viewport={{ once: true }}
        >
          "Learning, Living, and Leveling Up."
        </motion.div>

        <h3 className="text-3xl font-bold mb-6">GetInTouch();</h3>

        <div className="mb-8 space-y-2">
          <p>abhishek@example.com</p>
          <p>+91 XXXXX XXXXX</p>
          <p>GitHub: @abhishek</p>
        </div>

        <div className="flex justify-center space-x-6 mb-8">
          {socialIcons.map((social, index) => (
            <motion.a
              key={index}
              href={social.link}
              target="_blank"
              rel="noopener noreferrer"
              className="text-2xl"
              whileHover={{ 
                y: -5,
                scale: 1.2,
                color: '#FF6A00'
              }}
              whileTap={{ scale: 0.9 }}
            >
              {social.icon}
            </motion.a>
          ))}
        </div>

        <div className="text-gray-400">
          <p>Design & Built by Abhishek Borkar ¬© 2025</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
